  summary: Spécifie les champs de ressource disponibles en tant que paramètre pour le [Document](xref:office.Office.Document)<!-- -->.getResourceFieldAsync méthode.
  remarks: >-
    Une constante ProjectResourceFields peut être utilisée en tant que paramètre du [Document](xref:office.Office.Document)<!-- -->.getResourceFieldAsync méthode.


    Pour plus d’informations sur l’utilisation des champs de projet, voir [champs disponibles](https://support.office.com/article/Available-fields-reference-615a4563-1cc3-40f4-b66f-1b17e793a460) reference. Dans l’aide de Project, recherchez les champs disponibles.


    **Informations de prise en charge**


    Un Y majuscule dans la matrice suivante indique que cette énumération est prise en charge dans l'application hôte Office correspondante. Une cellule vide indique que l'application hôte Office ne prend pas en charge cette énumération.


    Pour plus d’informations sur les exigences des applications et le serveur hôte Office, voir [Configuration requise pour exécuter des compléments Office](https://docs.microsoft.com/office/dev/add-ins/concepts/requirements-for-running-office-add-ins)<!-- -->.


